import React, { Component } from 'react';

class Home extends Component {
    api_key = "gKqNNLdx3R6yG0GiFbOOAScG4u6SKbJK";

    constructor(props) {
        super(props);
        this.state = {
            bookCategories: []
        };
    }

    componentDidMount() {
        fetch(`https://api.nytimes.com/svc/books/v3/lists/names.json?api-key=${this.api_key}`)
            .then(response => response.json())
            .then(data => this.setState({bookCategories: data.results}));
    }

    render() {
        return (
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <a class="navbar-brand" href="#">NYTimes Bestsellers</a>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarNav">
                <ul class="navbar-nav">
                { this.state.bookCategories.map((element, index) => {
                    if (index === 0) {
                        return <li class="nav-item active">
                            <a class="nav-link" href="#"> {element.list_name} <span class="sr-only">(current)</span></a>
                        </li>;
                    } else {
                        return <li class="nav-item">
                            <a class="nav-link" href="#" list_name_encoded={element.list_name_encoded}> { element.list_name } </a>
                        </li>
                    }
                })}
                </ul>
            </div>
            </nav>
        );
    }
}

export default Home;
